import React from 'react';

class GithubUsers extends React.Component {

	render() {
		return(
			<div className="cards">
				<img src={props.user.avatar_url} alt="user photo"/>
				<div>
					<h3>{props.user.name}</h3>
					<p>{props.user.login}</p>
					<p>{props.user.location}</p>
					<p>Profile:</p>
					<a href={props.user.html_url}><p>{props.user.html_url}</p></a>
					<p>{props.user.followers}</p>
					<p>{props.user.following}</p>
					<p>{props.user.bio}</p>
				</div>
			</div>
		)
	}
}

export default GithubUsers;
